import React from "react";

const ImageCompressor = () => {
  return (
    <div style={{ width: "600px", margin: "20px auto" }}>
      <form>
        <div className="col">
          <input className="form-control" type="file" />
        </div>
      </form>
    </div>
  );
};

export default ImageCompressor;
